import { Board } from "./Board";
import { colors } from "./Colors";
import { Figure } from "./figures/Figure";

export class Cell {
	readonly x: number;
	readonly y: number;
	readonly color: colors;
	figure: Figure | null;
	board: Board;
	available: boolean;
	id: number;

	constructor(
		board: Board,
		x: number,
		y: number,
		color: colors,
		figure: Figure
	) {
		this.x = x;
		this.y = y;
		this.board = board;
		this.color = color;
		this.figure = figure;
		this.available = false;
		this.id = Math.random();
	}
}
